Продажа автомобиля официальным дилером NISSAN МОТОР ЛЕНД:
Подменный автомобиль
1 владелец - официальный дилер Nissan МОТОРЛЕНД (ПТС оригинал),
Полный комплект ключей.
Оригинальный пробег
Бережная эксплуатация и своевременное обслуживание у официального дилера (сервисная книжка).
Преимущества покупки автомобиля с пробегом в автосалоне NISSAN МОТОР ЛЕНД:

         Проведены проверки автомобиля по всем базам, юридическая чистота гарантирована;
         Автомобиль прошел предпродажную подготовку и полностью готов к дальнейшей эксплуатации без дополнительных вложений, предоставляется заказ-наряд;
         Безопасность при проведении сделки купли-продажи автомобиля, все документы/оплата автомобиля оформляются/осуществляется в автосалоне;
         Действует услуга trade in, выгода до 50 000 рублей;
         Программа автокредитования Nissan Finance с пониженной ставкой и выгодой до 25 000 рублей;
         Оформление гарантии и программы помощи на дорогах;
         Помощь в государственной регистрации ТС;
         Cashback 0,5% от стоимости автомобиля на карту лояльности МОТОР ЛЕНД;
         Акция «БЕНЗИН НА ГОД ПОДАРОК»! Условия уточняйте у менеджеров по продажам.

Осмотр по адресу: Изыскателей 23 (дилерский центр NISSAN) с 08.00 до 21.00.
Заранее благодарим за предварительный звонок!
